      <img src="imgs/defaultperson.jpg" alt="Image"/>
      <p>{student.gpa}</p>
      This student is currently not enrolled in a school.</div>
    );
  }
  return (
    <div>
      <h1>{student.firstname + " " + student.lastname}</h1>
      <h3>{student.email}</h3>
      <img src="imgs/defaultperson.jpg" alt="Image"/>
